return {MORNING = "早安，长官……今天我也会全力投入到工作中的。", AFTERNOON = "请不必担心，对于我所在的行业来说，“对肉食流露出厌恶”不过是常态而已。", EVENING = "您喜欢科幻电影吗？特别是那种B级科幻片……比如《异怪》和《银河舰队》。", MIDNIGHT = "对我而言，工作到半夜可是司空见惯的事情呢，虽然感觉很糟糕……", DIALOGUE1 = "任何事物都有属于自己的意志，任何事物都有属于自己的存在意义……抱歉，又开始喃喃自语了。", DIALOGUE2 = "在现代技术面前，没有人能够完美地抹除自己的行动痕迹……对，没有人能做到这点。", DIALOGUE3 = "", DIALOGUE4 = "不见了吗……那么，到哪里可以找到长官呢？", DIALOGUE5 = "您有什么事情吗？我想回宿舍好好休息一下……昨晚的工作又累又糟糕。", INTERACT1 = "嗯……？", INTERACT2 = "呃……", INTERACT3 = "看来您现在有空呢。", NEWYEAR = "新年到了啊……那么，长官可以给我一点特别的奖励吗？只要一张贺卡就够了。", VALENTINE = "一点微不足道的小小礼物，普通得不能再普通的罐装巧克力……请长官收下吧，这样的话我会很高兴的。", TANABATA = "和那些我每天都要看到的东西相比，万圣节的鬼怪实在是无足轻重……等一下，可以给我多留两块南瓜馅饼吗？我有点饿了。", ALLHALLOWS = "其实……除了被制作成烤南瓜派外，南瓜也可以用于花艺。不过花卉的颜色也需要遵循严格的要求，像非洲菊和郁金香之类的金色花朵，则是首选中的首选。", CHRISTMAS = "圣诞节快乐，长官。您知道……我不太接受肉食的吧？所以我把圣诞晚餐的菜单全部换成甜点和蔬菜了。不过，如果您觉得不合口味的话，我可以再额外准备一些肉菜的。", PLAYERBIRTHDAY = "既然是生日，长官就要打起十分的精神来才行。说起来，今天《异怪》系列的新作上映了呢，您可以陪我一起去看看吗？", GAIN = "我是莉丝，详细的自我介绍就免了吧，以后您会慢慢了解的。", LEVELUP = "感觉自己又变强了……我可是没有极限的。", RANKUP = "追踪那些常人难觅的蛛丝马迹，抓住每一个弱点和漏洞，才能开启通往真相之门。", RANKMAX = "我会努力去适应这一切、尽力做好每一件事的，请您放心好了。", FORMATION = "开始工作吧。", BATTLE = "那么，该出发了。", SKILL = "将死之人，何足挂齿。", MVP1 = "一切都结束了。", MVP2 = "任务顺利完成。", DUTY = "打起精神，好好工作吧。", RETREAT = "唔……", RELATIONSHIP1 = "呃……我是不是看上去糟透了？\n衣服上的红色痕迹？只是不小心把颜料洒上去了而已……\n清洁一下就行了，没必要担心的。", RELATIONSHIP2 = "我只是单纯不喜欢吃肉而已……出厂设置就这样。\n也许程序设计师是个素食主义者呢？他将个人习惯写入了我的原始程序当中。\n真的只有这个原因，请您不要胡思乱想，我会不高兴的。", RELATIONSHIP3 = "长官对科幻电影有兴趣吗？\n我的话，其实更喜欢那种B级科幻片啦，就是……满屏幕都是血浆那种。因为我的职业……不对，因为我天生就喜欢这些廉价的感官刺激，真是够奇怪的……", RELATIONSHIP4 = "您又来找我聊天了吗……\n诶，您是怎么知道的？难道是那位女仆小姐……\n算了，那我干脆说出来吧。其实我干的是法医的工作哦，每天都要和那些超出常人忍受能力的东西打交道。为了不让他人感到害怕，我一般是不会对外人说这些的。", RELATIONSHIP5 = "真正的梦想……？\n如果我说以后想要投身电影事业呢？从一个影迷转型为业内的工作人员……一切都要重新来过吧。毕竟是转行嘛，需要从零开始学习新的东西。\n您也有过别的想法吗？说出来吧，没关系的。", OATH = "您真的没有对我感到害怕吗？毕竟……\n不过，您看上去似乎心意已决了呢。那么，我也会做出回应的……我，很高兴呢。", TITLE = "云图计划"}

